        private GpsCoordinates ParseLine(string line)
        {
            MatchCollection matches, coordinates;
            matches = Regex.Matches(line, @"(\d{2}(, min: |°?, minutes: |\s*(['°?])\s*)()?\d{2}( sec: | and seconds: |\s*([']{2}?|[']?)\s*)( and secs: )?((\d{1,2}\.\d{1,4})|\d$)|\d{2}\.\d{3,6}\s*?(Latitude|Longitude|lat|lon|E|N|e|n))");
            double latitude, longitude;
            if (matches.Count == 0)
            {
                coordinates = Regex.Matches(line, @"\d+\.\d+");
                latitude = Helpers.ParseDouble(coordinates[0].Value);
                longitude = Helpers.ParseDouble(coordinates[1].Value);
            }
            else
            {
                string newline = matches[0].ToString() + " " + matches[1].ToString();
                coordinates = Regex.Matches(newline, @"(\d{1,2}\.\d+|\d{2}|\d)");
                if (coordinates.Count == 2)
                {
                    latitude = Helpers.ParseDouble(coordinates[0].Value);
                    longitude = Helpers.ParseDouble(coordinates[1].Value);
                }
                else
                {
                    latitude = Helpers.ConvertDMSToDD(int.Parse(coordinates[0].Value), int.Parse(coordinates[1].Value), Helpers.ParseDecimal(coordinates[2].Value));
                    longitude = Helpers.ConvertDMSToDD(int.Parse(coordinates[3].Value), int.Parse(coordinates[4].Value), Helpers.ParseDecimal(coordinates[5].Value));
                }
            }
            var result = CheckCoordinatesOrder(latitude, longitude);
            return new GpsCoordinates(result.Item1, result.Item2);
        }

        private Tuple<double, double> CheckCoordinatesOrder(double latitude, double longitude)
        {
            if (latitude.CompareTo(longitude) < 0)
            {
                return new Tuple<double, double>(longitude, latitude);
            }
            return new Tuple<double, double>(latitude, longitude);
        }
